import React, { useState } from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';

const ListadoProyectos = () => {
  const [proyectoSeleccionado, setProyectoSeleccionado] = useState('');

  const handleSelectChange = (event) => {
    setProyectoSeleccionado(event.target.value);
  };

  // Genera las opciones para el select
  const opcionesProyectos = [];
  for (let i = 1; i <= 15; i++) {
    opcionesProyectos.push(<MenuItem value={`Proyecto ${i}`}>Proyecto {i}</MenuItem>);
  }

  const cardStyle = {
    marginTop: '25px',
    marginLeft: '50px',
    marginRight: '50px',
    borderRadius: '20px', // Bordes redondeados
  };

  const buttonStyle = {
    backgroundColor: '#DA291C', // Color de fondo
    color: '#FFF', // Color de texto
    marginRight: '10px', // Espacio entre los botones
    borderRadius: '10px'  };

  return (
    <Card style={cardStyle}>
      <CardContent>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img src="images/protectosListadoIcn.svg" alt="Icono" style={{ marginRight: '10px' }} />
          <Typography variant="h6" style={{ fontSize: 14, fontWeight: 'bold' }}>
            Proyectos
          </Typography>
        </div>
        <Typography variant="body2" style={{ marginTop: '10px', marginBottom:'35px' }}>
          Directorio de Proyectos Disponibles
        </Typography>
        <div style={{ marginTop: '10px' }}>
          <Button variant="contained" style={buttonStyle}>
            <img src="images/uploadIcn.svg" alt="Upload" style={{ marginRight: '5px' }} />
            Botón
          </Button>
          <Button variant="contained" style={buttonStyle}>
            <img src="ruta-al-icono.svg" alt="Botón" style={{ marginRight: '5px' }} />
            Botón
          </Button>
          <Button variant="contained" style={buttonStyle}>
            <img src="ruta-al-icono.svg" alt="Botón" style={{ marginRight: '5px' }} />
            Botón
          </Button>
        </div>
        <FormControl fullWidth style={{ marginTop: '20px' }}>
          <Select
            value={proyectoSeleccionado}
            onChange={handleSelectChange}
            displayEmpty
            inputProps={{ 'aria-label': 'Without label' }}
          >
            {opcionesProyectos}
          </Select>
        </FormControl>
      </CardContent>
    </Card>
  );
};

export default ListadoProyectos;
